import './particle.css'
import Particles from 'react-particles-js'

function Particle(){
    return (
        <div>
            <Particles 
                params={{
                    polygon: {
                        enable: true,
                        type: 'inside',
                        move: {
                            radius: 10
                        }
                    }
                }} />
        </div>
    );
  }

  export default Particle;
